import React, { useEffect } from 'react';
import logo from './logo.svg';
import { Counter } from './features/counter/Counter';
import './App.css';
import axios from 'axios';
import { setListingData } from './actions/index';
import { connect } from 'react-redux';
import Listing from './listing/Listing';

function App(props) {
  useEffect(() => {
    axios.get('https://jsonplaceholder.typicode.com/posts').then(res => {
      console.log(res.data);
      props.setListingData(res.data);
    })
  },[])
  useEffect(() => {
    console.log('listingData ---- ',props.listingData);
  })
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Listing />
      </header>
    </div>
  );
}

const mapStateToProps = state => {
  return {
    listingData: state.listing.listingData
  }
};

export default connect(mapStateToProps,{setListingData})(App);
